function Social(){
    return (
        <ul>
        <li>  <label for="box1">Mohannad</label><input type="checkbox" name="box1" className = "checkboxs" />   </li>
        <li><input type="checkbox" name="box2" className = "checkboxs" /> <label for="box1">Jalal</label> </li>
        <li><input type="checkbox" name="box3" className = "checkboxs" /> <label for="box1">jayousi</label> </li>

  </ul>
    );
}

export default Social ;
